import { Container, Row, Col } from 'react-bootstrap';
import LetsOrder from '../components/LetsOrder';
import NavbarBucks from '../components/NavbarBucks';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';

const Home = () =>{
    return(
        <>
        <div>
            <NavbarBucks/>
            <div>
            <Container>
                <Waysbucks/>
                <Row>
                    <h1 className='LetsOrder'>Let's Order</h1>
                    <col><LetsOrder/></col>
                </Row>
            </Container>
            </div>
        </div>


        </>
    )
}

export default Home
